import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Task from './components/Task';

import './styles/App.css';
import { Button, TextField, Card, Typography } from '@mui/material';

function App() {
  const [tasks, setTasks] = useState([]);
  const [newTask, setNewTask] = useState({ title: '', description: '' });
  const [isEditing, setIsEditing] = useState(false);
  const [currentTask, setCurrentTask] = useState(null);

  // Fetch tasks on component mount
  useEffect(() => {
    fetchTasks();
  }, []);

  // Fetch all tasks from the back-end API
  const fetchTasks = async () => {
    try {
      const response = await axios.get('http://localhost:3000/tasks');
      setTasks(response.data);
    } catch (err) {
      console.error('Error fetching tasks:', err);
    }
  };

  // Handle form input for new tasks
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewTask((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  // Create a new task
  const addTask = async () => {
    try {
      const response = await axios.post('http://localhost:3000/tasks', newTask);
      setTasks([...tasks, response.data]);
      setNewTask({ title: '', description: '' });
    } catch (err) {
      console.error('Error adding task:', err);
    }
  };

  // Delete a task
  const deleteTask = async (id) => {
    try {
      await axios.delete(`http://localhost:3000/tasks/${id}`);
      setTasks(tasks.filter((task) => task.id !== id));
    } catch (err) {
      console.error('Error deleting task:', err);
    }
  };

  // Update a task
  const updateTask = async () => {
    try {
      const response = await axios.put(`http://localhost:3000/tasks/${currentTask.id}`, currentTask);
      setTasks(tasks.map((task) => (task.id === currentTask.id ? response.data : task)));
      setIsEditing(false);
      setCurrentTask(null);
    } catch (err) {
      console.error('Error updating task:', err);
    }
  };

  // Set current task for editing
  const handleEdit = (task) => {
    setCurrentTask(task);
    setIsEditing(true);
  };

  // Handle form input for editing tasks
  const handleEditChange = (e) => {
    const { name, value } = e.target;
    setCurrentTask((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  return (
    <div className="App">
      <Typography variant="h3" gutterBottom align="center">
        Task Manager
      </Typography>

      {/* New Task Form */}
      {!isEditing ? (
        <Card className="mb-4 p-3">
          <Typography variant="h5" gutterBottom>
            Add New Task
          </Typography>
          <TextField
            label="Task title"
            name="title"
            variant="outlined"
            fullWidth
            margin="normal"
            value={newTask.title}
            onChange={handleInputChange}
          />
          <TextField
            label="Task description"
            name="description"
            variant="outlined"
            fullWidth
            margin="normal"
            multiline
            rows={4}
            value={newTask.description}
            onChange={handleInputChange}
          />
          <Button variant="contained" color="primary" onClick={addTask}>
            Add Task
          </Button>
        </Card>
      ) : (
        <Card className="mb-4 p-3">
          <Typography variant="h5" gutterBottom>
            Edit Task
          </Typography>
          <TextField
            label="Task title"
            name="title"
            variant="outlined"
            fullWidth
            margin="normal"
            value={currentTask.title}
            onChange={handleEditChange}
          />
          <TextField
            label="Task description"
            name="description"
            variant="outlined"
            fullWidth
            margin="normal"
            multiline
            rows={4}
            value={currentTask.description}
            onChange={handleEditChange}
          />
          <Button variant="contained" color="success" onClick={updateTask}>
            Update Task
          </Button>
        </Card>
      )}

      {/* Display Tasks */}
      <div className="task-list">
        {tasks.map((task) => (
          <Card className="mb-4 p-3" key={task.id}>
            <Typography variant="h6">{task.title}</Typography>
            <Typography variant="body1">{task.description}</Typography>
            <Button variant="contained" color="error" onClick={() => deleteTask(task.id)}>
              Delete
            </Button>
            <Button variant="contained" color="secondary" onClick={() => handleEdit(task)} style={{ marginLeft: '10px' }}>
              Edit
            </Button>
          </Card>
        ))}
      </div>
    </div>
  );

}

export default App;
